import React, { useState, useEffect } from "react";
import axios from "axios";
import {
  Container,
  TextField,
  Button,
  Table,
  TableBody,
  TableCell,
  TableHead,
  TableRow,
  Paper,
  MenuItem,
  Select,
  InputLabel,
  FormControl,
} from "@mui/material";

const PropertyManager = () => {
  const [properties, setProperties] = useState([]);
  const [formData, setFormData] = useState({
    name: "",
    address: "",
    size: "",
    price: "",
    status: "white",
  });
  const [images, setImages] = useState([]);
  const [searchTerm, setSearchTerm] = useState("");
  const [editingId, setEditingId] = useState(null);

  const fetchProperties = async () => {
    try {
      const res = await axios.get("http://localhost:5000/api/property");
      setProperties(res.data);
    } catch (err) {
      console.error(err);
    }
  };

  useEffect(() => {
    fetchProperties();
  }, []);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleFileChange = (e) => {
    setImages(e.target.files);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const data = new FormData();
    data.append("name", formData.name);
    data.append("address", formData.address);
    data.append("size", formData.size);
    data.append("price", formData.price);
    data.append("status", formData.status);

    for (let i = 0; i < images.length; i++) {
      data.append("images", images[i]);
    }

    try {
      if (editingId) {
        await axios.put(`http://localhost:5000/api/property/${editingId}`, data, {
          headers: { "Content-Type": "multipart/form-data" },
        });
        setEditingId(null);
      } else {
        await axios.post("http://localhost:5000/api/property", data, {
          headers: { "Content-Type": "multipart/form-data" },
        });
      }

      setFormData({ name: "", address: "", size: "", price: "", status: "white" });
      setImages([]);
      fetchProperties();
    } catch (err) {
      console.error(err);
    }
  };

  const handleEdit = (prop) => {
    setEditingId(prop._id);
    setFormData({
      name: prop.name,
      address: prop.address,
      size: prop.size,
      price: prop.price,
      status: prop.status,
    });
  };

  const handleDelete = async (id) => {
    try {
      await axios.delete(`http://localhost:5000/api/property/${id}`);
      fetchProperties();
    } catch (err) {
      console.error(err);
    }
  };

  const getStatusStyle = (status) => {
    const baseStyle = {
      padding: '4px 12px',
      borderRadius: '20px',
      fontSize: '0.8rem',
      fontWeight: '500',
      textTransform: 'uppercase',
      letterSpacing: '0.5px',
    };
    switch (status?.toLowerCase()) {
      case 'white':
        return { ...baseStyle, backgroundColor: '#fff', color: '#000', border: '1px solid #ccc' };
      case 'yellow':
        return { ...baseStyle, backgroundColor: '#fff3cd', color: '#856404' };
      case 'black':
        return { ...baseStyle, backgroundColor: '#000', color: '#fff' };
      default:
        return baseStyle;
    }
  };

  const filteredProperties = properties.filter(
    (prop) =>
      prop.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
      prop.address.toLowerCase().includes(searchTerm.toLowerCase())
  );

  const handleReport = () => {
    const csvContent = [
      ["Property ID", "Name", "Address", "Size", "Price", "Status"].join(","),
      ...properties.map(p => [
        p.PropertyId,
        p.name,
        p.address,
        p.size,
        p.price,
        p.status
      ].join(",")),
    ].join("\n");

    const blob = new Blob([csvContent], { type: "text/csv" });
    const link = document.createElement("a");
    link.href = URL.createObjectURL(blob);
    link.download = "properties_report.csv";
    link.click();
  };

  const styles = {
    container: { padding: '2rem 0' },
    header: { textAlign: 'center', marginBottom: '2rem' },
    formContainer: { padding: '2rem', marginBottom: '2rem', border: '1px solid #ccc', borderRadius: '12px' },
    submitButton: { marginTop: '1rem' },
    tableContainer: { borderRadius: '12px', overflow: 'hidden', marginTop: '1rem' },
    tableHeaderCell: { fontWeight: '600' },
    tableCell: { fontSize: '0.9rem' },
    fileInput: { marginTop: '1rem' },
  };

  return (
    <div style={styles.container}>
      <Container>
        <h1 style={styles.header}>Property Management System</h1>

        <div style={styles.formContainer}>
          <form onSubmit={handleSubmit}>
            <TextField
              label="Property Name"
              name="name"
              value={formData.name}
              onChange={handleChange}
              fullWidth
              margin="normal"
            />
            <TextField
              label="Address"
              name="address"
              value={formData.address}
              onChange={handleChange}
              fullWidth
              margin="normal"
            />
            <TextField
              label="Size (sq ft)"
              name="size"
              value={formData.size}
              onChange={handleChange}
              fullWidth
              margin="normal"
            />
            <TextField
              label="Price ($)"
              name="price"
              value={formData.price}
              onChange={handleChange}
              fullWidth
              margin="normal"
            />
            <FormControl fullWidth margin="normal">
              <InputLabel>Status</InputLabel>
              <Select name="status" value={formData.status} onChange={handleChange}>
                <MenuItem value="white">White</MenuItem>
                <MenuItem value="yellow">Yellow</MenuItem>
                <MenuItem value="black">Black</MenuItem>
              </Select>
            </FormControl>
            <div style={styles.fileInput}>
              <input type="file" multiple accept="image/*" onChange={handleFileChange} />
            </div>
            <Button type="submit" variant="contained" fullWidth sx={styles.submitButton}>
              {editingId ? "Update Property" : "Add Property"}
            </Button>
          </form>
        </div>

        <TextField
          placeholder="Search by Name or Address..."
          fullWidth
          margin="normal"
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
        />

        <Button variant="outlined" onClick={handleReport} sx={{ marginBottom: '1rem' }}>
          Generate Report
        </Button>

        <Paper style={styles.tableContainer}>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell sx={styles.tableHeaderCell}>ID</TableCell>
                <TableCell sx={styles.tableHeaderCell}>Name</TableCell>
                <TableCell sx={styles.tableHeaderCell}>Address</TableCell>
                <TableCell sx={styles.tableHeaderCell}>Size</TableCell>
                <TableCell sx={styles.tableHeaderCell}>Price</TableCell>
                <TableCell sx={styles.tableHeaderCell}>Status</TableCell>
                <TableCell sx={styles.tableHeaderCell}>Images</TableCell>
                <TableCell sx={styles.tableHeaderCell}>Actions</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {filteredProperties.map((prop) => (
                <TableRow key={prop._id}>
                  <TableCell sx={styles.tableCell}>{prop.PropertyId}</TableCell>
                  <TableCell sx={styles.tableCell}>{prop.name}</TableCell>
                  <TableCell sx={styles.tableCell}>{prop.address}</TableCell>
                  <TableCell sx={styles.tableCell}>{prop.size}</TableCell>
                  <TableCell sx={styles.tableCell}>{prop.price}</TableCell>
                  <TableCell sx={{ ...styles.tableCell, ...getStatusStyle(prop.status) }}>
                    {prop.status}
                  </TableCell>
                  <TableCell sx={styles.tableCell}>
                    {prop.images?.map((img, idx) => (
                      <img key={idx} src={img} alt="Property" style={{ width: 60, height: 45, marginRight: 4 }} />
                    ))}
                  </TableCell>
                  <TableCell sx={styles.tableCell}>
                    <Button size="small" onClick={() => handleEdit(prop)}>Update</Button>
                    <Button size="small" color="error" onClick={() => handleDelete(prop._id)}>Delete</Button>
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </Paper>
      </Container>
    </div>
  );
};

export default PropertyManager;
